import React from 'react'
import { Text, View, Image, TouchableOpacity } from 'react-native'
import { Icon } from 'react-native-elements'

export const FoodTile = () => {
    return (
        <View>
            <Text>Hello, This Works</Text>
        </View>
    );
};


